    false,nt"url": null,nt"notes": "This map displays optical validation observation
    locations and percent coverage of scleractinian coral and sand overlaid on bathymetry
    and landsat imagery. Optical data were collected by CRED TOAD camera sled aboard
    the Hawaiian Islands Humpback Whale National Marine Sanctuary small boat R/V Kohola
    cruise SB1505, NOAA small boat R/V AHI cruise MP1401, NOAA ship Hi'ialakai cruise
    HA0905 and aboard NOAA ship Oscar Elton Sette cruise SE1107, SE1006 & SE0807. Data
    were also collected with Hawaii Undersea Research Laboratory's (HURL) RCV-150 remotely
    operated vehicle (ROV) in 2001-2002, 2004, 2006 and on the R/V Ka`imikai-o-Kanaloa
    cruise's; KOK1207, KOK0408, KOK0209, KOK0409, KOK1002 & KOK1102. Diver Photquadrant
    data were collected by the CRED Benthic Team in 2005-2006, 2008, 2010 & 2014. Drop
    camera data were collected by the United States Geological Survey (USGS) in 2002-2003
    and 2011.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
